-- Create the database
CREATE DATABASE Lumony;

-- Use the database
USE Lumony;

-- Create Administrator table
CREATE TABLE Administrator (
    Admin_ID CHAR(6) PRIMARY KEY,
    Admin_fname VARCHAR(50) NOT NULL,
    Admin_lname VARCHAR(50) NOT NULL,
    Admin_email VARCHAR(100) NOT NULL,
    Admin_address VARCHAR(255) NOT NULL,
    Admin_DOB DATE NOT NULL
);

-- Insert data into Administrator

-- Create Administrator_Account table
CREATE TABLE Administrator_Account (
    Acc_ID CHAR(6) PRIMARY KEY,
    Acc_username VARCHAR(50) NOT NULL,
    Acc_password VARCHAR(255) NOT NULL,
    Admin_ID CHAR(6) NOT NULL,
    FOREIGN KEY (Admin_ID) REFERENCES Administrator(Admin_ID)
);

-- Insert data into Administrator_Account

-- Create the Lumony database
CREATE DATABASE IF NOT EXISTS Lumony;
USE Lumony;

-- Create the Product table
CREATE TABLE IF NOT EXISTS Product (
    Product_ID INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
    Product_name VARCHAR(50) NOT NULL,
    Product_brand VARCHAR(50) NOT NULL,
    Product_type VARCHAR(20) NOT NULL,
    Product_volume INT NOT NULL,
    Product_price DECIMAL(10,2) NOT NULL,
    Product_image LONGTEXT NOT NULL,
    Product_description VARCHAR(400)
);


